import React from "react";
import QuoteList from "../components/quotes/QuoteList";
const DUMMY_QUOTES = [
  { id: "q1", author: "max", text: "learning react in fun" },
  { id: "q2", author: "max", text: "learning react in fun" },
  { id: "q3", author: "max", text: "learning react in fun" },
  { id: "q4", author: "max", text: "learning react in fun" },
];
const AllQuotes = () => {
  return <QuoteList quotes={DUMMY_QUOTES} />;
};

export default AllQuotes;
